import SectionHead from "../SectionHead"
export default function WhyChooseUs() {
    return (
        <>
            <div className="whychooseus-section">
                <SectionHead  sectionHead={"Why Choose Us"} hh={"Because <b>“we’re converting great ideas into great apps by great people.”</b> We provide you truly leading IT solutions for your better business growth."}/>
            </div>
        </>
    )
}
